import React from "react";

const Dropdown=(props)=>{
    return(

       <select name={props.name} >
        {props.option.shift()}
        {props.options.map(option=>(
            <option value={option[0]}>{option[1]}</option>
        ))}
        
       </select>
    )
}
export default Dropdown;
